import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
}));

export const FilterTime = () => {
  const classes = useStyles();
  const [age, setAge] = React.useState('');

  const handleChange = (event) => {
    setAge(event.target.value);
  };

  return (
    <div>
        <FormControl className={classes.formControl}>
            <InputLabel shrink id="demo-simple-select-placeholder-label-label">
                Age
          </InputLabel>
            <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            onChange={handleChange}
            >
            <MenuItem value={10}>7 ngày trước</MenuItem>
            <MenuItem value={20}>30 ngày trước</MenuItem>
            <MenuItem value={30}>tháng trước</MenuItem>
            <MenuItem value={30}>tháng này</MenuItem>
            <MenuItem value={30}>tùy chọn</MenuItem>
            </Select>
        </FormControl>
        <FormControl className={classes.formControl}>
        <InputLabel shrink id="demo-simple-select-placeholder-label-label">
          Age
        </InputLabel>
            <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            onChange={handleChange}
            >
            <MenuItem value={10}>Dịch Vụ Trả Phí Khác</MenuItem>
            <MenuItem value={20}>Cửa Hàng</MenuItem>
            <MenuItem value={30}>Quảng Cáo</MenuItem>
            <MenuItem value={30}>gói tin</MenuItem>
            <MenuItem value={30}>gói nạp tiền</MenuItem>
            <MenuItem value={30}>Thành viên</MenuItem>
            </Select>
        </FormControl>
    </div>
  );
}
